import React from 'react';
import { NavLink } from 'react-router-dom';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './Pages.css';
import Section from '../ProjectSection/ProjectSections.js';

function Projects() {

  return( 
    <div className="aligned-sec">
      <div className="left-sec">
        <NavLink to='/Development' className="left-sec-section">
          <p className="category">Development</p>
          <p>Swift • XCode</p>
          <p>React</p>
          <p>JS • CSS • HTML</p>
          <p>C# • Unity</p>
          <p>Processing</p>
        </NavLink>

        <NavLink to='/Fun' className="left-sec-section">
          <p className="category">Fun</p>
          <p>Physical Computing</p>
          <p>Textiles</p>
        </NavLink>

      </div>
      <div className="right-sec">
        <div className="project-section">
          <Switch>
            <Route path = '/Development' exact component={Development}/>
            <Route path = '/Design' exact component={Design}/>
            <Route path = '/Fun' exact component={Fun}/>
          </Switch>
        </div>
      </div>
    </div>
  )
}

export default Projects;

export function Development() {
  return (
    <>
      {projectArr.length>0?
        <>
          {
            projectArr.map((item, i) => {
              return <Section
                key={ i }
                href={ "/" + i }
                title={ item.Title }
                category={ item.Category }
                dates={ item.Dates }
                body={ item.Summary }
                link={ item.Link }
              />
            })
          }
        </> : <h1>{projectArr.length}</h1>}
    </>
  );
}

export function Design() {
  return (
    <>
      <h1>DESIGN</h1>
    </>
  );
}

export function Fun() {
  return (
    <>
      <h1>FUN</h1>
    </>
  );
}

async function fetchCsv() {
  const response = await fetch('data/mycsv.csv');
  const reader = response.body.getReader();
  const result = await reader.read();
  const decoder = new TextDecoder('utf-8');
  const csv = await decoder.decode(result.value);
  console.log('csv', csv);
  return csv;
}


function csvArray(str, delim) {
  const headers = str.slice(0,str.indexOf('\n')).split(delim);
  const rows = str.slice(str.indexOf('\n')+1).split('\n');

  const newArray = rows.map( row => {
    const values = row.split(delim);
    const eachObject = headers.reduce((obj, header, i) => {
        obj[header] = values[i];
        return obj;
    }, {})
    return eachObject;
  })

  return newArray;
}
